model_class: TorchModel
input_variables:
  TOD_fs3:
    variable_class: ScalarVariable
    default_value: 80000.0
    is_constant: false
    value_range: [-80000.0, 80000.0]
    value_range_tolerance: 1.0e-08
  GVD:
    variable_class: ScalarVariable
    default_value: 13.6
    is_constant: false
    value_range: [13.0, 14.0]
    value_range_tolerance: 1.0e-08
  z_target_um:
    variable_class: ScalarVariable
    default_value: 100.0
    is_constant: false
    value_range: [-150.0, 150.0]
    value_range_tolerance: 1.0e-08
output_variables:
  n_protons: {variable_class: ScalarVariable, is_constant: false, value_range_tolerance: 1.0e-08}
input_validation_config: null
output_validation_config: null
model: ip2_model.jit
input_transformers: [ip2_input_transformers_0.pt]
output_transformers: [ip2_output_transformers_0.pt, ip2_output_transformers_1.pt]
output_format: tensor
device: cpu
fixed_model: true
precision: double
